'''
1047. Remove All Adjacent Duplicates In String
https://leetcode.com/problems/remove-all-adjacent-duplicates-in-string/
'''

from test_tool import assert_value


class Solution:
    def removeDuplicates(self, s: str) -> str:
        res = []
        for c in s:
            if res and res[-1] == c:
                res.pop()
                continue
            res.append(c)
        return ''.join(res)

    def removeDuplicates_v1(self, s: str) -> str:
        stack = []
        for c in s:
            if not stack or stack[-1] != c:
                stack.append(c)
            else:
                stack.pop()
        return ''.join(stack)

    def removeDuplicates_v0(self, s: str) -> str:
        s = list(s)
        while True:
            cnt = 0
            i = 0
            while i < len(s) - 1:
                if s[i] == s[i + 1]:
                    del s[i: i + 2]
                    i -= 1
                    i = max(0, i)
                    cnt += 1
                else:
                    i += 1
            if cnt == 0:
                return ''.join(s)
        return ''


assert_value("ca", Solution().removeDuplicates, s="abbaca")
assert_value("ay", Solution().removeDuplicates, s="azxxzy")
assert_value("", Solution().removeDuplicates,
             s="")
